import React from 'react';
import '../../App.css';
import { Button } from '../Button';
import './Monitor.css';
import MonitorRow from './MonitorRow';
import Title from '../Title'

function Monitor() {
    return (
        <div class="contentContainer">
            <Title title='Monitor List' />
            <MonitorRow />
            <MonitorRow />
            <MonitorRow />
        </div>
    );
}

export default Monitor;
